void RoundValues(vector<FloatType> & distances){
    auto first = distances.begin();
    auto last = distances.end();
    std::transform(first, last, first, [=](auto v){
        return round(v);
    });
}

void RoundDistances(vector<FloatType> & distances){
    auto first = distances.begin();
    auto last = distances.end();
    std::transform(first, last, first, [=](auto v){
        return round(v);
    });
}

